// actions.js
export const SET_LANGUAGE = 'SET_LANGUAGE';
export const TOGGLE_AUTH = 'TOGGLE_AUTH';

export const setLanguage = () => {
    return {
        type: SET_LANGUAGE,
    };
};

export const toggleAuth = () => {
    return {
        type: TOGGLE_AUTH,
    };
};
